import axios from "axios";

const CLEARDB_DATABASE_URL = "http://localhost:8080/passagens";

class PassagensService {
  getAllPassagens() {
    return axios.get(CLEARDB_DATABASE_URL);
  }

  createPassagens(passagens) {
    return axios.post(CLEARDB_DATABASE_URL, passagens);
  }

  getPassagensById(passagensId) {
    return axios.get(CLEARDB_DATABASE_URL + "/" + passagensId);
  }

  updatePassagens(passagensId, passagens) {
    return axios.put(CLEARDB_DATABASE_URL + "/" + passagensId, passagens);
  }

  deletePassagens(passagensId) {
    return axios.delete(CLEARDB_DATABASE_URL + "/" + passagensId);
  }
}

export default new PassagensService();
